import React from "react";
import "./App.css";
import TodosContainer from "./containers/TodosContainer";
import { useEffect } from "react";
import axios from "axios";
import DeleteChecked from "./components/DeleteChecked";

function App() {
  // useEffect(() => {
  //   axios
  //     .get("http://localhost:8080/todos")
  //     .then((response) => console.log(response));
  // });
  return (
    <div className="Todo">
      <table className="Templates">
        <tbody>
          <tr>
            <td>
              <div className="blueTemplate"></div>
            </td>
            <td>
              <div className="pinkTemplate"></div>
            </td>
            <td>
              <div className="greenTemplate"></div>
            </td>
            <td>
              <div className="purpleTemplate"></div>
            </td>
          </tr>
        </tbody>
      </table>
      <div className="Todo-Delete-Btn-Div">
        <DeleteChecked />
      </div>

      <div className="Todo-Header">ToDo</div>
      <div className="Todo-Form">
        <TodosContainer />
      </div>
    </div>
  );
}

export default App;
